import React from 'react';

/*
    Legg til onClick på pil tilbake for å gå til forrige side
    Legg til onClick på øl for å komme til hjemsiden
    Legg til onHove
*/

export class Header extends React.Component {


    render() {
        return(
            <div className='top-0 bg-violet-600 h-14'>
                <div className='inline-flex'>
                    <p className="pt-3 pr-28 text-xl" >⬅️</p>
                    <p className='font-italic text-base content-center pt-4  text-white'>Dashboard</p>
                    <p className='pt-2 pl-28'>🍻</p>
                </div>
            </div>
        );
    }
}
